const NoStudent = () => {
    return (
      <Box
        style={{
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          alignItems: "center",
          height: "100vh"
        }}
      >
        <Typography variant="h6" style={{ color: "#6A6A6A", marginBottom: 5 }}>
          You have not added any student information, please add.
        </Typography>
        <Button
          variant="contained"
          color="primary"
          onClick={() => Router.push("/school/add")}
        >
          Add Student
        </Button>
      </Box>
    );
  };

  const Index = () => {
    return <NoStudent />;
  };
  export default Index;
